function onDragStart(evt) {
    var localPos = this.localize(evt.getPosition());
    this.vertices = [localPos, localPos];
    // Create a green polyline with width 3
    this.line = this.addMorph(Morph.makeLine(this.vertices, 3, Color.green));
}

