function onDrag(evt) {
    var localPos = this.localize(evt.hand.getPosition());
    // Add point to the curve if significant movement
    if (localPos.dist(this.vertices.last()) > 15) {
        this.vertices.push(localPos);
        this.line.setVertices(this.vertices);
    }
}

